import "./App.css";
import logo from "./assets/logo.png";
import TableBox from "./components/tableBox/TableBox";
import ULBox from "./components/ULBox/ULBox";

//let 은 값이 변할 수 있는 변수, const 는 한번 값을 대입하면 변경이 불가능한 상수
//const 변수 = function(){} ECMA6 이전 Style
//UI 컴포넌트 용도는 첫글자를 대문자로 사용한다 (아래와 같이 UI 를 만들어 변환하는 함수를 functional Component - UI 단뒤 (함수로 만들어진 UI))

const ImgBox = () => {
  return (
    <div className="imageBox">
      <img src={logo}></img>
    </div>
  );
};

function App() {
  //reactApp 의 시작점 = Main
  return (
    //JSX
    <div className="container">
      <TableBox />
      <TableBox />
      <TableBox />

      <ULBox />
      <ImgBox />
    </div>
  );
}

export default App;
//위 코드가 없으면 index js 가 이 App 을 못가져 간다.
